column2:
I am a graphic designer currently pursuing my education at Kharkiv National University of Radio Electronics, specializing in Publishing and Printing at the Department of Media Systems and Technologies. I have taken courses from Genius.Space in "Web Design" and "UX/UI Design".

Attention to detail and the ability to structure information help me to create clear action plans, which is an important aspect of being a UX designer. Continuous learning and practice develop my skills related to visualization and graphic elements (UI).

Soft skills: 
- teamwork;
- empathy;
- enjoyment of work;
- punctuality and discipline.

Graphic editors: 
- figma;
- adobe illustrator;
- adobe photoshop;
- blender;
- autoCAD.

I have experience in commercial projects, particularly in creating a set of business cards for a tattoo artist who is currently working abroad. Additionally, I have worked on various projects including website designs, brochures, presentations, and logos.

Proficient user of Figma, Adobe Illustrator, Adobe Photoshop, Miro;
Use of styles, components, variants in design;
Knowledge of typography, work with raster and vector graphics;
Understanding of the principles of usability;
Experience in creating web sites, adaptive design;
Knowledge of Google Materials Design and Apple Human Interface Guidelines;
Creating interactive prototypes.

Hello! My name is Yana and I am a UX/UI designer. I love Figma, I work well with hotkeys, autolayouts, variants, and components. I like modern minimalism designs that do their job well. I am ready to work and develop in different styles and directions.

1. Designed a landing page for a sugaring salon. Experience in analyzing competitors, creating a user profile. Working with color and typography.

2. Redesigned a real site. During the project, I made a working prototype, wireframes, created a kit, created product cards in autolayout, and worked with components and variants. Interested in new and innovative projects. Would like to work with a passionate team of professionals. Love to be a part of a Design Team. Clear management, flexible working hours. Full-time or part-time work; Remote work; Product companies; Social projects; E-commerce industry.
